use std::collections::VecDeque;

struct Solution;

impl Solution {
    pub fn predict_party_victory(senate: String) -> String {
        let mut radiant_queue = VecDeque::new();
        let mut dire_queue = VecDeque::new();
        let n = senate.len();

        for (index, ch) in senate.chars().enumerate() {
            if ch == 'R' {
                radiant_queue.push_back(index);
            } else {
                dire_queue.push_back(index);
            }
        }

        while !radiant_queue.is_empty() && !dire_queue.is_empty() {
            let (radiant_index, dire_index) = (
                radiant_queue.pop_front().unwrap(),
                dire_queue.pop_front().unwrap(),
            );
            if radiant_index < dire_index {
                radiant_queue.push_back(radiant_index + n);
            } else {
                dire_queue.push_back(dire_index + n);
            }
        }

        if radiant_queue.is_empty() {
            "Dire".to_string()
        } else {
            "Radiant".to_string()
        }
    }
}

#[cfg(test)]
mod tests {
    use crate::problem_0649::Solution;

    #[test]
    fn test_1() {
        assert_eq!(
            Solution::predict_party_victory("".to_string()),
            "Dire".to_string()
        );
    }
}
